import './ArticleViewer.css';
import ArticleSidebar from './ArticleSidebar';

class ArticleViewer extends Component {
    constructor(){
        let url = this.props.url == undefined ? "https://www.git-tower.com/learn/git/ebook/en/command-line/advanced-topics/merge-conflicts" : this.props.url;
        console.log("URL:", url);
    }

    render() {
        return (
          <div className="ArticleViewer">
              <iframe title="Article" src="{ url }"></iframe>
              <ArticleSidebar/>
          </div>
        );
    }
}

export default ArticleViewer;
